import React, { Component }from 'react';


class Vehicle extends Component {
    constructor() {
        super()
        this.state = {
            vehicle: [],
        }
    }

    componentDidMount() {
        fetch("https://swapi.co/api/vehicles/")
            .then(response => response.json())
            .then(user => this.setState({ vehicle: user.results }));
    }
}

export default Vehicle;
